<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Michael Bishop | Finance Manager | Star Lincoln</title>
    <link href="https://fonts.googleapis.com/css2?family=Playfair+Display:wght@400;500;600;700&family=Montserrat:wght@300;400;500;600&display=swap" rel="stylesheet">
    <style>
        * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
        }

        body {
            font-family: 'Montserrat', sans-serif;
            min-height: 100vh;
            background: linear-gradient(180deg, #0a0a12 0%, #1a1a2e 50%, #0d0d1a 100%);
            display: flex;
            justify-content: center;
            align-items: center;
            padding: 20px;
        }

        .card {
            width: 100%;
            max-width: 420px;
            background: linear-gradient(180deg, #12121f 0%, #1a1a2e 40%, #0f0f1a 100%);
            border-radius: 24px;
            overflow: hidden;
            box-shadow: 
                0 25px 80px rgba(0,0,0,0.6),
                0 0 1px rgba(192,192,192,0.3),
                inset 0 1px 0 rgba(255,255,255,0.05);
            position: relative;
        }

        .card::before {
            content: '';
            position: absolute;
            top: 0;
            left: 0;
            right: 0;
            height: 2px;
            background: linear-gradient(90deg, transparent, rgba(192,192,192,0.5), transparent);
        }

        /* Star pattern overlay */
        .star-pattern {
            position: absolute;
            top: 0;
            left: 0;
            right: 0;
            bottom: 0;
            background-image: 
                radial-gradient(circle at 20% 30%, rgba(192,192,192,0.03) 1px, transparent 1px),
                radial-gradient(circle at 80% 70%, rgba(192,192,192,0.03) 1px, transparent 1px),
                radial-gradient(circle at 50% 50%, rgba(192,192,192,0.02) 1px, transparent 1px);
            background-size: 60px 60px, 80px 80px, 40px 40px;
            pointer-events: none;
        }

        .photo-section {
            position: relative;
            width: 100%;
            height: 320px;
            overflow: hidden;
        }

        .photo-section img {
            width: 100%;
            height: 100%;
            object-fit: cover;
            object-position: top center;
        }

        .photo-overlay {
            position: absolute;
            bottom: 0;
            left: 0;
            right: 0;
            height: 150px;
            background: linear-gradient(to top, #12121f 0%, transparent 100%);
        }

        /* Lincoln Star Logo */
        .lincoln-star {
            position: absolute;
            top: 15px;
            right: 15px;
            width: 40px;
            height: 40px;
            opacity: 0.8;
        }

        .lincoln-star svg {
            width: 100%;
            height: 100%;
            fill: rgba(192, 192, 192, 0.7);
        }

        .content {
            padding: 25px 30px 35px;
            position: relative;
            z-index: 1;
        }

        .chrome-divider {
            width: 80px;
            height: 2px;
            background: linear-gradient(90deg, #666, #c0c0c0, #666);
            margin: 0 auto 20px;
            border-radius: 1px;
        }

        .name {
            font-family: 'Playfair Display', serif;
            font-size: 32px;
            font-weight: 600;
            color: #ffffff;
            text-align: center;
            letter-spacing: 1px;
            margin-bottom: 8px;
            text-shadow: 0 2px 10px rgba(0,0,0,0.3);
        }

        .title {
            font-size: 14px;
            font-weight: 500;
            color: #c0c0c0;
            text-align: center;
            text-transform: uppercase;
            letter-spacing: 3px;
            margin-bottom: 5px;
        }

        .company {
            font-family: 'Playfair Display', serif;
            font-size: 18px;
            font-weight: 400;
            color: #8a8a9a;
            text-align: center;
            letter-spacing: 2px;
            margin-bottom: 25px;
        }

        .contact-info {
            margin-bottom: 25px;
        }

        .contact-item {
            display: flex;
            align-items: center;
            padding: 12px 0;
            border-bottom: 1px solid rgba(192,192,192,0.1);
            text-decoration: none;
            color: inherit;
            transition: all 0.3s ease;
        }

        .contact-item:last-child {
            border-bottom: none;
        }

        .contact-item:hover {
            background: rgba(192,192,192,0.05);
            padding-left: 10px;
            margin-left: -10px;
            margin-right: -10px;
            padding-right: 10px;
            border-radius: 8px;
        }

        .contact-icon {
            width: 40px;
            height: 40px;
            background: linear-gradient(135deg, #2a2a3e 0%, #1a1a2e 100%);
            border-radius: 10px;
            display: flex;
            align-items: center;
            justify-content: center;
            margin-right: 15px;
            border: 1px solid rgba(192,192,192,0.15);
        }

        .contact-icon svg {
            width: 18px;
            height: 18px;
            fill: #c0c0c0;
        }

        .contact-text {
            flex: 1;
        }

        .contact-label {
            font-size: 10px;
            color: #666;
            text-transform: uppercase;
            letter-spacing: 1px;
            margin-bottom: 2px;
        }

        .contact-value {
            font-size: 14px;
            color: #e0e0e0;
            font-weight: 400;
        }

        .save-button {
            width: 100%;
            padding: 18px 30px;
            background: linear-gradient(135deg, #1e3a5f 0%, #0d2137 100%);
            border: 1px solid rgba(192,192,192,0.3);
            border-radius: 12px;
            color: #ffffff;
            font-family: 'Montserrat', sans-serif;
            font-size: 14px;
            font-weight: 600;
            text-transform: uppercase;
            letter-spacing: 2px;
            cursor: pointer;
            transition: all 0.3s ease;
            display: flex;
            align-items: center;
            justify-content: center;
            gap: 12px;
            box-shadow: 
                0 10px 30px rgba(0,0,0,0.3),
                inset 0 1px 0 rgba(255,255,255,0.1);
        }

        .save-button:hover {
            background: linear-gradient(135deg, #264d7a 0%, #143252 100%);
            border-color: rgba(192,192,192,0.5);
            transform: translateY(-2px);
            box-shadow: 
                0 15px 40px rgba(0,0,0,0.4),
                inset 0 1px 0 rgba(255,255,255,0.15);
        }

        .save-button:active {
            transform: translateY(0);
        }

        .save-button svg {
            width: 20px;
            height: 20px;
            fill: #c0c0c0;
        }

        .footer {
            margin-top: 25px;
            text-align: center;
            padding-top: 20px;
            border-top: 1px solid rgba(192,192,192,0.1);
        }

        .footer-text {
            font-size: 10px;
            color: #4a4a5a;
            text-transform: uppercase;
            letter-spacing: 2px;
        }

        @media (max-width: 480px) {
            body {
                padding: 10px;
            }
            .card {
                border-radius: 20px;
            }
            .photo-section {
                height: 280px;
            }
            .content {
                padding: 20px 25px 30px;
            }
            .name {
                font-size: 28px;
            }
        }
    </style>
</head>
